import React from 'react'

function DisplayInfo(props) {
    return (props.infoTrigger)?(
        <div >
            <div >
                <p>
                    <b>App Name: </b>{this.state.appName}
                    <br/>
                    <b>Store Name: </b> {this.state.storeName}
                    <br/>
                    <b>Bundle Id: </b>{this.state.bundleId}
                    <br/>
                    <b>Server: </b>{this.state.server}
                    <br/>
                </p>
            </div>
        </div>
    ): "";
}

export default DisplayInfo
